import React from "react";
import Navbar from "./Components/Navbar";
import { BrowserRouter, Router, Route } from "react-router-dom";
import Home from "./Components/Home";
function App() {
  return (
    <>
      <div>
        <BrowserRouter>
          {" "}
          <Navbar />
          <Router>
            <Route element={<Home />}></Route>
          </Router>
        </BrowserRouter>
      </div>
    </>
  );
}

export default App;
